import React from 'react';
import { Card } from 'react-bootstrap';
import { keyboard ,mouse } from '../../Config';

class NewProducts extends React.Component {
  render() {
    return (
      <div className="mainContentbg">
        <div className="container">
          <h1 className="text-center text-white p-5">顧客回饋</h1>
          <div className="row">
            <div className="col-sm-6 p-0">
              <a href="/product">
                <Card border="dark">
                  <Card.Img
                    src={keyboard[3].image}
                    alt=""
                  />
                </Card>
              </a>
            </div>
            <div className="col-sm-6 text-white p-0 d-flex justify-content-center">

            </div>
            <div className="col-sm-6 text-white p-0">456</div>
            <div className="col-sm-6 p-0">
              <a href="/product">
                <Card border="dark">
                  <Card.Img
                    src={mouse[4].image}
                    alt=""
                  />
                </Card>
              </a>
            </div>

          </div>
        </div>
        <hr className="hrLine" />
      </div>
    );
  }
}

export default NewProducts;
